package arraylist;

import java.util.ArrayList;
import java.util.List;

public class Listal {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Integer a=10;
		List<Integer> al= new ArrayList<>();
		
		for(int i=0;i<al.size();i++) {
			
				al.add(a);
				al.add(1);
				al.add(2);
				al.add(3);
				al.add(4);
				
		
		}
		System.out.println(al);

	}

}
